import React from 'react';
import Encabezado from './Encabezado';

class InputCamion extends React.Component{
    render(){
        return(
            <div className="form-inline">
                <div className="form-group mb-2">
                    <input type="text" readonly className="form-control-plaintext" id="staticEmail2" value="Camion 1" />
                </div>
                <div className="form-group mx-sm-3 mb-2">
                <div className="input-group">
                        <input name = {"cant" + this.props.nombre + this.props.nro} type="number" className="form-control" aria-label="Demanda en kg"></input>
                        <div className="input-group-append">
                            <span className="input-group-text">kg</span>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default InputCamion;
